import React, { useState, useEffect, useContext } from 'react';
import axios from 'axios';
import UserContext from '../context/UserContext';
import { useDefaultStyles, paragraphStyles, buttonReadyStyles, buttonDeleteStyles } from '../context/Default_Designs';

const PatronOrders = () => {
  const { authUser } = useContext(UserContext);
  const defaultStyles = useDefaultStyles();
  const [patronOrders, setPatronOrders] = useState([]);
  const [expandedOrders, setExpandedOrders] = useState({});
  const [checkedItems, setCheckedItems] = useState({});

  useEffect(() => {
    const fetchPatronOrders = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/users/${encodeURIComponent(authUser._id)}/patronOrders`);
        if (response.status === 200) {
          setPatronOrders(response.data.patronOrders);
          const initialExpanded = response.data.patronOrders.reduce((acc, _, index) => {
            acc[index] = true; // Set all orders to expanded initially
            return acc;
          }, {});
          setExpandedOrders(initialExpanded);
        } else {
          console.error('Error fetching patron orders: status', response.status);
        }
      } catch (error) {
        console.error('Error fetching patron orders:', error);
      }
    };

    if (authUser) {
      fetchPatronOrders();
    }
  }, [authUser]);

  const toggleOrder = (index) => {
    setExpandedOrders(prevState => ({
      ...prevState,
      [index]: !prevState[index]
    }));
  };

  const handleCheckItem = (orderIndex, itemIndex) => {
    const updatedCheckedItems = { ...checkedItems };
    if (!updatedCheckedItems[orderIndex]) {
      updatedCheckedItems[orderIndex] = {};
    }
    updatedCheckedItems[orderIndex][itemIndex] = !updatedCheckedItems[orderIndex][itemIndex];
    setCheckedItems(updatedCheckedItems);
  };

  const isOrderComplete = (orderIndex) => {
    const orderCheckedItems = checkedItems[orderIndex] || {};
    return patronOrders[orderIndex].items.every((_, itemIndex) => orderCheckedItems[itemIndex]);
  };

  return (
    <div>
      <h2>Your Orders</h2>
      <div style={{ ...defaultStyles, color: 'white' }}>
        <p style={paragraphStyles}>Total Orders: {patronOrders.length}</p>
      </div>
      {patronOrders.length > 0 ? (
        patronOrders.map((order, index) => (
          <div key={order.mainkey} style={{ ...defaultStyles, position: 'relative' }}>
            <div onClick={() => toggleOrder(index)} style={{ cursor: 'pointer', borderBottom: '2px solid black', paddingBottom: '10px', marginBottom: '10px' }}>
              <h3 style={{ color: defaultStyles.backgroundColor }}>Order {order.orderNumber} {isOrderComplete(index) && <span style={{ color: 'red' }}>X</span>}</h3>
              <p>Main Key: {order.mainkey}</p>
              <p>Timestamp: {order.timestamp}</p>
              <p>Items Count: {order.items.length}</p>
            </div>
            {expandedOrders[index] && (
              <div>
                <h3>Items:</h3>
                {order.items.map((item, itemIndex) => (
                  <div key={itemIndex} style={{ marginBottom: '10px', borderBottom: `1px solid ${defaultStyles.backgroundColor}`, paddingBottom: '10px' }}>
                    <p style={{ backgroundColor: defaultStyles.backgroundColor, color: 'black', padding: '5px', borderRadius: '3px' }}>Item Name: {item.title}</p>
                    <p>Item ID: {item.foodId}</p>
                    <p>Quantity: {item.quantity}</p>
                    <p>Price: ${item.price}</p>
                    <label>
                      <input
                        type="checkbox"
                        checked={checkedItems[index] && checkedItems[index][itemIndex]}
                        onChange={() => handleCheckItem(index, itemIndex)}
                      />
                      Mark as completed
                    </label>
                  </div>
                ))}
              </div>
            )}
          </div>
        ))
      ) : (
        <p>No orders found</p>
      )}
    </div>
  );
};

export default PatronOrders;
